import swal from "sweetalert";
import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import axios from 'axios';
const URI = "http://localhost:8080//"

const Registrarse = () => {
  const [nombre, setNombre] = useState('');
  const [clave, setClave] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();

    // Realizar la solicitud HTTP al backend de Spring Boot
    axios.post('http://localhost:8080/cliente/registrarse', {
      nombre: nombre,
      clave: clave,
    })
    .then((response) => {
      console.log('Cliente registrado exitosamente:', response.data);
      // Aquí puedes agregar acciones adicionales después del registro exitoso, como redireccionar a otra página.
    })
    .catch((error) => {
      console.error('Error al registrar cliente:', error);
      // Aquí puedes manejar el error, mostrar mensajes al usuario, etc.
    });
    navigate('/cliente');
  };

  return (
    <div>
      <h2>Registro de Cliente</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Nombre:</label>
          <input type="text" value={nombre} onChange={(e) => setNombre(e.target.value)} />
        </div>
        <div>
          <label>Clave:</label>
          <input type="password" value={clave} onChange={(e) => setClave(e.target.value)} />
        </div>
        <button type="submit">Registrar</button>
      </form>
    </div>
  );
};

export default Registrarse
